import {
    Container,
    Row,
    Col,
    Button,
    Modal,
    ListGroup,
    Spinner,
  } from "react-bootstrap";
import "./MainPage.css"

export default class MainPage extends React.Component {
    render() {
        return (
            <div className='web-container'>
                <div className='mainpart'>
                    <Spinner 
                    animation="border" 
                    role="status"
                    style={{display: 'none'}}>
                        <span className="sr-only">Loading...</span>
                    </Spinner>
                    <Container className='sizeDecide'>

                    </Container>
                </div>
            </div>
        );
    }
}
